import React from "react";

const ReloadButton = () => {
  const handleReload = () => {
    window.location.reload(); // Reload the page
  };

  return (
    <button onClick={handleReload} className="submit-button">
      New Lineup
    </button>
  );
};

export default ReloadButton;
